script: |
  super -f text -I q5443.spq | sort > q5443.out

inputs:
  - name: q5443.spq
    data: |
      SELECT - 9 / - ( - + COUNT ( * ) ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5443.out
    data: |
      -1
